import { Link } from "react-router-dom";

function DropInMenu() {
    return (
        <div id="menu">
            <Link to="/recommender" style={{ textDecoration: 'none' }}><p className="menuItem">Recommender</p></Link>
            <Link to="/plot-builder" style={{ textDecoration: 'none' }}><p className="menuItem">Plot Builder</p></Link>                     
            <Link to="/captain-picks" style={{ textDecoration: 'none' }}><p className="menuItem">Captain Picks</p></Link>  
            <Link to="/contact" style={{ textDecoration: 'none' }}><p className="menuItem">Contact</p></Link>          
        </div>

    )
};

export default DropInMenu;
